import React, { useContext, useEffect } from 'react';
import { NavLink } from 'react-router-dom';
import classes from './BottomHeader.module.css';
import { Context } from 'Context/Context';

export default function BottomHeader() {
    const { dispatch } = useContext(Context);
    const openModal = () => {
        if (dispatch) {
            dispatch({ type: 'resetModal', payload: { isOpenModal: true } });
        }
    };
    return (
        <nav className={classes.header__navbar}>
            <NavLink className={classes.header__navbar_link} to="/">
                Главная
            </NavLink>
            <NavLink className={classes.header__navbar_link} to="/catalog">
                Каталог
            </NavLink>
            <NavLink className={classes.header__navbar_link} to="/about">
                О компании
            </NavLink>
            <NavLink className={classes.header__navbar_link} to="/contacts">
                Контакты
            </NavLink>
        </nav>
    );
}
